import "./LastNameForm.css";
const LastNameForm = () => {
  return (
    <div className="first-name-parent">
      <div className="first-name">First name</div>
      <div className="email">Email</div>
      <div className="phone-number">Phone number</div>
      <div className="last-name">Last name</div>
      <img className="frame-item" alt="" src="/vector-1.png" />
      <img className="frame-inner" alt="" src="/vector-3.png" />
      <img className="vector-icon" alt="" src="/vector-3.png" />
      <img className="frame-child1" alt="" src="/vector-2.png" />
    </div>
  );
};

export default LastNameForm;
